{{Slot tables F2P}}
The '''Weapons table''' shows all weapons ([[Melee]], [[Ranged]] and [[Magic]]) that are currently in Old School RuneScape, showing their attack and defence bonuses.

'''Note''': Two-handed weapons, such as claws and godswords, are '''not''' listed here. Instead, they are found [[Two-handed slot table (F2P)|here.]]

Also note that because weapons have different speeds you can not directly compare their attributes. To compare weapons you should ideally use a <abbr title="Damage per Second">DPS</abbr> calculator, but a reasonable alternative is to use [[Calculator:Armoury]] and toggle '''Normalize'''. Normalize scales strength-like attributes with the weapon's speed. At least for melee weapons this can be used as a proxy for damage output. With ranged weapons, the ammo will have a big effect on damage so keep that in mind. Likewise for magic weapons, the spell is the most significant factor for the damage. 

